import './App.css';

function App() {
  const [text, setText] = useState('')
  const onSubmit = () => {
    // do something
    console.log(text)
  }
  return (
    <div className="App">
      <input type='text' value={text} onChange={e => setText=e.target.value}></input>

      <input type='submit' onClick={onSubmit}></input>
    </div>
  );
}

export default App;
